import React from "react"
import './Cartao.css'
import gerar_cor from '../components/coraleatoria'


const Cartao = props => {

    let cor = gerar_cor()

    let estilo = {
        backgroundColor: cor || 'gray',
        borderColor: cor || 'black',
    }
        
    return (
        <div className="Cartao" style={estilo}>
            
        </div>
          
    )
}
export default Cartao
